pragma solidity ^0.8.30;

contract EnviarEther{

    function enviarEther(address endereco) public {

        endereco.call{value: 1 ether}(""); // call
        payable(endereco).transfer(1 ether); // trannsfer
        payable(endereco).send(1 ether); // send
    }
}
